import React, { useContext } from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Button, Typography } from '@mui/material';
import { useState } from 'react';
import axios from 'axios';
import bg from '../assets/bg.jpg'
import store from '../App'
const Foodlogs = () => {
     const [token,setToken]=useContext(store);
     const [data,setData]=useState({
        qty:'',
        Unit:'',
        food:'',
        Calories:'',
        date:''
     })
      const changehandler=e=>{
        setData({...data,[e.target.name]:e.target.value})
      }
      const submitHandler=e=>{
        e.preventDefault();
        axios.post('http://localhost:5000/foodlogs',{
            headers:{
                'x-token':token
            },
            data
        }).then(
          res => alert("registered")
        )
      }
  return (
    <Box>
        
    <img src={bg} alt="banner" className="hero-banner1-img"/>
      <div>
      <Typography fontWeight={50} sx={{fontSize:{lg:'30px',xs:'20px'}}} mt='50px'textAlign={"center"}>RegisterNow</Typography>
        <TextField
          sx={{
            input:{
                fontWeight:'700',
                border:'none',
                borderRadius:'4px',
                
            },
            width:{lg:'400px',xs:"350px"},
            backgroundColor:'#fff',
            borderRadius:"40px",
            mx: 'auto',
            ml:60,
            mb:5,
            mt:2,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700'
        }}
          required
          id="outlined-required"
          label="Required"
          type="text"
          onChange={changehandler}
          name="qty"
          placeholder='Quantity'
        /><br/>
        <TextField
        sx={{
          input:{
              fontWeight:'700',
              border:'none',
              borderRadius:'4px'
          },
          width:{lg:'400px',xs:"350px"},
          backgroundColor:'#fff',
          borderRadius:"40px",
          mx: 'auto',
          ml:60,
          mb:5,
          mt:1,
        textAlign: 'center',
        fontSize: '0.875rem',
        fontWeight: '700'
      }}
          id="outlined-required"
          label="Required"
          type="text"
          name="unit"
          onChange={changehandler}
          placeholder='Unit'
        /><br/>
        <TextField
        sx={{
          input:{
              fontWeight:'700',
              border:'none',
              borderRadius:'4px'
          },
          width:{lg:'400px',xs:"350px"},
          backgroundColor:'#fff',
          borderRadius:"40px",
          mx: 'auto',
            ml:60,
            mb:5,
            mt:1,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700'
      }}
          id="outlined-password-input"
          label="Password"
          type="text"
          name="food"
          onChange={changehandler}
          
        /><br/>
        <TextField
        sx={{
          input:{
              fontWeight:'700',
              border:'none',
              borderRadius:'4px'
          },
          width:{lg:'400px',xs:"350px"},
          backgroundColor:'#fff',
          borderRadius:"40px",
          mx: 'auto',
            ml:60,
            mb:5,
            mt:1,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700'
      }}
          id="outlined-password-input"
          label="Password"
          type="text"
          name="calories"
          placeholder='calories'
          onChange={changehandler}
          
        /><br/>
        <TextField
            sx={{
              input:{
                  fontWeight:'700',
                  border:'none',
                  borderRadius:'4px'
              },
              width:{lg:'400px',xs:"350px"},
              backgroundColor:'#fff',
              borderRadius:"40px",
              mx: 'auto',
                ml:60,
                mb:5,
                mt:1,
              textAlign: 'center',
              fontSize: '0.875rem',
              fontWeight: '700'
          }}
              id="outlined-password-input"
              label="Password"
              type="text"
              name="date"
              onChange={changehandler}
              placeholder='dd/mm/yyyy'
            /><br/>
        <Box textAlign={'center'} ml={10}>
           <Button variant='contained' ml={40}  onClick={submitHandler}sx={{backgroundColor:'#7EC8E3',padding:'150', width:{lg:'400px',xs:"300px"},}}>Add</Button><br/>
           <Button variant='contained' mb={3} sx={{backgroundColor:'#7EC8E3',padding:'150',width:{lg:'400px',xs:"300px"},}} href="Login" >Already Registered</Button>
        </Box>
      </div>
    </Box>
  )
}

export default Foodlogs
